import { Container, Typography } from '@mui/material'
import React from 'react'

const PageBanner = () => {
  return (
    <>
    <Container sx={{
                    display:"flex",
                    justifyContent:"center",
                    alignItems:"center",
    }}>
        <Typography variant='h4'>Contact US</Typography>


    </Container>
    </>
  )
}

export default PageBanner
